import "bootstrap/dist/css/bootstrap.min.css";
import Navigation from "./components/Navigation";
import Footer from "./components/Footer";

function App() {
  return (
    <div>
      <Navigation />
      <Footer />
      <footer class="bg-primary text-center text-lg-start text-white">
        HAI IWINI
      </footer>
    </div>
  );
}

export default App;
